import { Card, CardContent, Typography, Box } from "@mui/material";
import AirIcon from "@mui/icons-material/Air";
import { lightBlue } from "@mui/material/colors";

export default function WindContainer({ wind }) {
  return (
    <Card
      variant="outlined"
      sx={{
        background: lightBlue[50],
        borderRadius: 4,
        boxShadow: 3,
        width: "100%",
        my: 2,
      }}
    >
      <CardContent sx={{ display: "flex", alignItems: "center", gap: 2 }}>
        <AirIcon sx={{ fontSize: 50, color: lightBlue[700] }} />
        <Box>
          <Typography variant="h6" fontWeight={500}>Wind Speed</Typography>
          <Typography variant="h5">{wind.speed} m/s</Typography>
        </Box>
      </CardContent>
    </Card>
  );
}
